    // useEffect(() => {
    //     getColaborador(globalState.usuario.subject).then((dados) => {
    //         if (dados.usuario.nomFun) {
    //             setDados(dados.usuario.nomFun)
    //             setState({ ...state, solicitante: dados.usuario.nomFun })
    //         }
    //     })
    // }, [])


